import { useSelector } from 'react-redux'

function Home() {

  const { user, userInfos } = useSelector(state => state.auth)
  if (user) {
    return (
      <div>
        {userInfos.Email}
      </div>
    )
  } else {
    return (
      <div>
        Bo≈ü
      </div>
    )
  }
}

export default Home
